// import logo from './logo.svg';
// import bootstrap from 'bootstrap';
// import firebase from "firebase/compat/app"
// import React from 'react';
// import { Button } from '@mui/material';
// import "firebase/firestore";
// import './App.css';

import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";
import { green } from "@mui/material/colors";
import CategoryListComposition from "./Components/CategoryList";
import { TextField } from "@mui/material";
import { Grid } from "@mui/material";

const theme = createTheme({
  palette: {
    primary: {
      main: green[200],
    },
    secondary: {
      main: green[500],
    },
  },

  components: {
    MuiCard: {
      styleOverrides: {
        root: { margin: 8, maxWidth: 345}
      },
    },
  },
});

function ButtonAppBar() {
  return (
    <ThemeProvider theme={theme}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            FrogNotes
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </ThemeProvider>
  );
}

function App() {
  return (
    <>
      <ButtonAppBar></ButtonAppBar>

      <Grid container spacing={2}>
        <Grid item xs={8}>
          <CategoryListComposition></CategoryListComposition>
        </Grid>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Name" variant="outlined" />
        </Grid>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Options" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
          <TextField id="outlined-basic" label="Price" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Cost" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Amount" variant="outlined" />
      </Grid>
      <Grid item xs={2}>
        <Button variant="contained">Add</Button>
      </Grid>
    </Grid>
    </>
  );
}

export default App;
